UIc.main._2x3=(i)=>{
	if (i==1){
		buzzer.nav(buzzer.buzz.ok);face.go('calc',0);
	}else if (i==2){
		buzzer.nav(buzzer.buzz.ok);face.go('repellent',0);
	}else if (i==3){
		buzzer.nav(buzzer.buzz.na);
		UI.btn.ntfy(1,1.5,0,"_bar",6,"NOT","AVAILABLE",15,13);w.gfx.flip();
		//buzzer.nav(buzzer.buzz.ok);face.go('tpmsFace',0);
	}else if (i==4){
		if (ew.is.bt!=6) {
			buzzer.nav(buzzer.buzz.na);
			if (!ew.def.hid){ UI.btn.ntfy(1,1.5,0,"_bar",6,"ENABLE HID","ON BT MENU",15,13);w.gfx.flip();}
			else {	UI.btn.ntfy(1,1.5,0,"_bar",6,"PHONE IS NOT","CONNECTED",15,13);w.gfx.flip();}
			return;
		}
		buzzer.nav(buzzer.buzz.ok);face.go('hid',0);
	}else if (i==5){
		buzzer.nav(buzzer.buzz.na);	
	}else if (i==6){
		buzzer.nav(buzzer.buzz.na);
	}
};


